import React, {Component} from 'react';
import './card.css';
import { Link } from 'react-router-dom';

interface CardProp {
	onDelete: (id: number) => void
	id: number,
	type: number,
	img_source: string,
	coffee_type: string,
	descirption: string,
}

export class Card extends React.Component<CardProp> {
	constructor(props:CardProp) {
		super(props);
	}

	render() {
		console.log(this.props.coffee_type)
		return (
			<>
				<div className="coffee">
					<Link to={{ pathname: '/form', state: { cof: {id : this.props.id,  descirption: this.props.descirption, type: this.props.type, img_source: this.props.img_source, coffee_type: this.props.coffee_type } } }}>
						<img src={this.props.img_source} />
					</Link>
					<div className="information">
						<div className="coffee_type">
							{this.props.coffee_type}
						</div>
						<div className="coffee_details">
							<p>{this.props.descirption}</p>
						</div>
						<button className="btn btn-danger" onClick={() => this.props.onDelete(this.props.id)}>Delete</button>
					</div>
				</div>
			</>
		);
	}
}

export default Card;
